import React from 'react'
import {Link} from 'react-router-dom'

function Navigation() {
    return (
        <div>
            <li>
                <Link to = "/mentor"> AddMentor </Link>
                <Link to = "/student"> AddStudent </Link>
            </li>

        </div>
    )
}

export default Navigation
